let squaresize = 30;
function setup() {
  createCanvas(windowWidth, windowHeight);
  strokeWeight(2);
  rectMode(CENTER);
  noFill();
  drawrect();//draws dem rectandkses
}
function drawrect() {
  let s = squaresize;
  for (let x=s/2;x<width-s/2;x+=s){
    for(let y =s/2;y<height-s/2;y+=s){
      let ra = map(y,0,height,1, 45);
      ra *= random(-1,1);
      push();
      let offs = map(y,0,height,0,20);
      translate(x,y);
      rotate(radians(ra));
      offs *= random(-1,1);
      square(offs,offs,s);
      pop();
    }
  }
}






















